import React from "react";
import './admin-css/login.css';
import my_picture from '../../assets/images/me.png';
import square from "../sub-components/Square";

export default function Login() {
    return(
        <>
            <div className="header">
                <div className="logo">
                    <h2>Dagos</h2>
                </div>
                <div className="menu">
                </div>
            </div>
        </>
    );
}
